import { styled } from 'styled-components';

export const Para = styled.p`
    .POSITIVE{
        color: green;
        font-weight: bold;
    }

    .NEGATIVE{
        color: red;
        font-weight: bold;
    }

    .divResult span{
        font-size: 20px;
    }

    .langu
`;
